import { Component } from "react";
import Project from "../Project/Project.js";

const projectsData = [
    {
        name: 'Guess the number',
        image: '',
        link: 'https://kirilyanev.github.io/Guess-the-number/',
        description: 'A simple game where you have to guess a random number.'
    },
];



class ProjectList extends Component {
    render () {
        projectsData.map(project => console.log(project));
        return (
            <ul className="project-list">
                <Project data={projectsData}/>
                <Project title="Guess the number"/>
                <Project />
            </ul>
        );
    }
}

export default ProjectList;
